import React, { useContext } from 'react'
import {BarangContext} from './context/BarangContext'
import NavHeader from './NavHeader';
import Barang from './Barang';
import AddBarang from './AddBarang';
import Cart from './Cart';
import Axios from 'axios';

const ListBarang = () => {
    const [barang,setBarang]=useContext(BarangContext);

    const getBarang = () => {
        Axios.get("http://localhost:3001/barang").then((response) => {
            setBarang(response.data)
        });
    };


    return (
        <div>
            <NavHeader />
            <AddBarang />
            <button onClick={getBarang}>Show Barang</button>
            {barang.map(barang => (
                <Barang id={barang.id}
                        tglMasuk = {barang.tglMasuk}
                        tglKeluar={barang.tglKeluar}
                        nama={barang.nama} 
                        harga={barang.harga}
                        stok={barang.stok}
                        counter={barang.count}/>
            ))}
        </div>
    )
}

export default ListBarang
